	public void testValidate_ADRB21_Success() throws JSONException {
		ValidatePostRequest req = new ValidatePostRequest();
		ValidatePostResponse resp = new ValidatePostResponse();

		setProperty("threadpool.size", "20");

		req.envelope = SwaggerUtils.base64Decode(envelopeADRB21);
		req.sha1 = SwaggerUtils.base64Decode("EMjARlRD0W9/lr/y1sp3nZf/uUxwKil03dUiOhvd2DU=");
		req.sha256 = SwaggerUtils.base64Decode("EMjARlRD0W9/lr/y1sp3nZf/uUxwKil03dUiOhvd2DU=");
		req.time = javax.xml.bind.DatatypeConverter.parseDateTime("2015-09-25T15:15:31.000-03:00").getTime();
		req.crl = false;
		run("POST", "/validate", req, resp);

		// TODO: trocar por "name"
		assertEquals("RENATO DO AMARAL CRIVANO MACHADO", resp.cn);
		assertEquals("AD-RB", resp.policy);
		assertEquals("2.16.76.1.7.1.1.2.1", resp.policyoid);
		assertEquals("2.1", resp.policyversion);
		assertTrue(resp.certdetails instanceof CertDetails);
		assertTrue(resp.errormsg == null);
	}

	public void testAttach_PKCS7_Success() throws JSONException {
		AttachPostRequest req = new AttachPostRequest();
		AttachPostResponse resp = new AttachPostResponse();

		req.envelope = SwaggerUtils.base64Decode(attachPKCS7detached);
		req.content = SwaggerUtils.base64Decode(attachPKCS7content);
		req.time = new Date(115, 1, 1);
		run("POST", "/attach", req, resp);

		assertEquals(attachPKCS7attached, SwaggerUtils.base64Encode(resp.envelope));
		assertEquals(attachPKCS7sha256hex, resp.sha256hex);
	}

	public void testP7SWithError() throws Exception {
		// Create a CMSProcessable object, specify any encoding, I have used
		// mine
		CMSProcessable signedContent = new CMSProcessableByteArray(Base64.decode(contentP7SWithError));
		// Create a InputStream object
		// byte[] decode = Base64.decode(signCms);
		InputStream is = new ByteArrayInputStream(Base64.decode(signP7SWithError));
		// Pass them both to CMSSignedData constructor
		CMSSignedData signedData = new CMSSignedData(signedContent, is);
		assertEquals("1.2.840.113549.1.7.1", signedData.getSignedContentTypeOID());

		Store store = signedData.getCertificates();
		SignerInformationStore signers = signedData.getSignerInfos();

		Collection c = signers.getSigners();
		java.util.Iterator it = c.iterator();

		while (it.hasNext()) {
			SignerInformation signer = (SignerInformation) it.next();

			Collection certCollection = store.getMatches(signer.getSID());
			java.util.Iterator certIt = certCollection.iterator();

			X509CertificateHolder certHolder = (X509CertificateHolder) certIt.next();
			X509Certificate cert = new JcaX509CertificateConverter().setProvider("BC").getCertificate(certHolder);

			assertFalse(signer.verify(new JcaSimpleSignerInfoVerifierBuilder().setProvider("BC").build(cert)));
		}
	}

